script: |
  super -f tsv -I q5678.sql | sort > q5678.out

vector: true

inputs:
  - name: q5678.sql
    data: |
      SELECT DISTINCT + cor0.col2 + cor0.col0 * cor0.col2 AS col1 FROM tab1 AS cor0 GROUP BY cor0.col2, cor0.col0, cor0.col2;
  - name: tab1

outputs:
  - name: q5678.out
    data: |
      1305
      184
      5893
